import React, { Component } from 'react';

class AllVideos extends Component {
    constructor(props) {
        super(props)
        this.state = {

        }
    }

    render() {
        const { data } = this.props;

        return (
            <div>
                {console.log(data)}
                {data.series.videos.map((video, i)=>(
                     <div> {video.id} </div>
                ))}
            </div>
        )
    }
}
export default AllVideos;
